import React from "react";
import Navbar from "../components/Navbar";

const MiddlemanDashboard = () => {
  return (
    <>
      <Navbar />
      <div className="p-6">
        <h1 className="text-3xl font-bold">Welcome, Middleman!</h1>
        <p className="mt-2 text-gray-600">Manage and promote products.</p>
      </div>
    </>
  );
};

export default MiddlemanDashboard;
